const namespace = 'taskdata';

const TaskData = ({
    data: {
        title,
        priority,
        status,
        description
    }
  }) => {

  return (
    <div className={`${namespace}__card`}>
      <div>{priority}</div>
      <div>{status}</div>
      <div>{title}</div>
      <div>{description}</div>
    </div>
  );
};

export default TaskData;
